import React from 'react';
import Slider from '@material-ui/core/Slider';
import tripListData from './TripListData';

// sport: 0,
// monuments: 3,
// party: 3,
// hotels: 5,
// restaurants: 5,


export default function SiteSlider ({tripListData}) {

  return (
    <>
      Sport: <Slider className={styles.slider} disabled max={5} valueLabelDisplay="on" defaultValue={tripListData.slider.sport} aria-labelledby="continuous-slider" />
      Monuments: <Slider className={styles.slider} disabled max={5} valueLabelDisplay="on" defaultValue={tripListData.slider.monuments} aria-labelledby="continuous-slider" />
      Party: <Slider className={styles.slider} disabled max={5} valueLabelDisplay="on" defaultValue={tripListData.slider.party} aria-labelledby="continuous-slider" />
      Hotels: <Slider disabled max={5} valueLabelDisplay="on" defaultValue={tripListData.slider.hotels} aria-labelledby="continuous-slider" />
      Restaurants: <Slider disabled max={5} valueLabelDisplay="on" defaultValue={tripListData.slider.restaurants} aria-labelledby="continuous-slider" />

    </>
  );
}
